  ---proceso de cambio de estado de producto
  PROCEDURE LDC_CAMBIO_ESTADO_PROD_DATAFIX(inuProduct pr_product.product_id%type) IS
  
    nuFlag number;
    nuSusp number;
  
    -- Cursor que consulta si el producto esta en estado 2-Suspendido
    cursor cuExistProduct(inuprod pr_product.product_id%type) is
      select 1
        from open.pr_product
       where product_id = inuprod
         and product_status_id = 2;
  
    -- Cursor que consulta si el producto tiene una suspension diferente a la de RP
    cursor cuSuspension(inuprod pr_product.product_id%type) is
      select 1
        from open.pr_prod_suspension
       where product_id = inuprod
         and suspension_type_id not in
             (SELECT TO_NUMBER(COLUMN_VALUE)
                FROM TABLE(LDC_BOUTILITIES.SPLITSTRINGS(DALD_PARAMETER.fsbGetValue_Chain('LDC_TIPO_SUSPENSION_RP',
                                                                                         NULL),
                                                        ',')))
         and active = 'Y';
  
  BEGIN
  
    UT_Trace.Trace('Inicia LDC_CAMBIO_ESTADO_PROD[' || inuProduct || ']',
                   1);
  
    -- valida que el producto capturado desde la instancia no sea nulo
    if (inuProduct is not null) then
      open cuExistProduct(inuProduct);
      fetch cuExistProduct
        into nuFlag;
      close cuExistProduct;
    
      -- valida que el producto exista y este en estado suspendido
      if (nuFlag = 1) then
      
        open cuSuspension(inuProduct);
        fetch cuSuspension
          into nuSusp;
        close cuSuspension;
      
        -- valida marca de suspension
        if (nuSusp is not null and nuSusp = 1) then
			DBMS_OUTPUT.PUT_LINE('NO SE ACTUALIZARA PRODUCTO :'||inuProduct||' TIENE SUSPENSION DE OTROS PROCESOS');
			nuControlError:=1;
        elsif (nuSusp is null or nuSusp <> 1) then
        
          begin
            update open.pr_product
               set product_status_id = 1, suspen_ord_act_id = null
             where product_id = inuProduct;
          
            update open.pr_component
               set component_status_id = 5
             where product_id = inuProduct;
          
            update open.compsesu
               set cmssescm = 5
             where cmsssesu = inuProduct;
          
            update open.pr_prod_suspension
               set inactive_date = sysdate, active = 'N'
             where product_id = inuProduct
               and suspension_type_id in
                   (SELECT TO_NUMBER(COLUMN_VALUE)
                      FROM TABLE(LDC_BOUTILITIES.SPLITSTRINGS(DALD_PARAMETER.fsbGetValue_Chain('LDC_TIPO_SUSPENSION_RP',
                                                                                               NULL),
                                                              ',')))
               and active = 'Y';
          
            -- actualizar suspension componente
            update open.pr_comp_suspension
               set inactive_date = sysdate, active = 'N'
             where component_id in
                   (select component_id
                      from pr_component
                     where product_id = inuProduct)
               and suspension_type_id in
                   (SELECT TO_NUMBER(COLUMN_VALUE)
                      FROM TABLE(LDC_BOUTILITIES.SPLITSTRINGS(DALD_PARAMETER.fsbGetValue_Chain('LDC_TIPO_SUSPENSION_RP',
                                                                                               NULL),
                                                              ',')))
               and active = 'Y';
          
            --commit;
          
          exception
            when others then
              rollback;
          end;
        
        end if;
        -- fin validacion prod_suspension
      else
        --dbms_output.put_line('El producto no se encuentra suspendido');
        -- El producto no esta suspendido
        --ge_boerrors.seterrorcodeargument(2741,
        --                                 'El producto no se encuentra suspendido');
        nuControlError := 1;
		DBMS_OUTPUT.PUT_LINE('NO SE ACTUALIZARA PRODUCTO :'||inuProduct||' EL PRODUCTO NO SE ENCUENTRA SUSPENDIDO');
      end if;
    else
      --dbms_output.put_line('No se logro capturar el producto de la instancia!!');
      -- No se capturo el producto de la instancia
      --ge_boerrors.seterrorcodeargument(2741,
      --                                 'No se logro capturar el producto de la instancia!!');
      nuControlError := 1;
    end if;
  
    UT_Trace.Trace('Fin LDC_CAMBIO_ESTADO_PROD', 1);
  
  EXCEPTION
    when ex.CONTROLLED_ERROR then
      raise ex.CONTROLLED_ERROR;
    when others then
      Errors.setError;
      raise ex.CONTROLLED_ERROR;
    
  END LDC_CAMBIO_ESTADO_PROD_DATAFIX;

  PROCEDURE LDC_TRAMITE_MOTIVO(InuPRODUCTO number,
                               InuContrato number,
                               InuCliente  number,
                               Isbuser_id  varchar2,
                               Isbterminal varchar2) is
  
    --Solicitud
    nupackage_id mo_packages.package_id%type;
    --Motivo
    nuMOTIVE_ID MO_MOTIVE.MOTIVE_ID%type;
    ------------------
  
  begin
  
    nupackage_id := 0;
    nuMOTIVE_ID  := 0;
  
    --Inicio Registro de Solcitud       
    nupackage_id := seq_mo_packages.nextval;
    insert into mo_packages mp
      (mp.package_id, --
       mp.request_date, --
       mp.messag_delivery_date, --
       mp.user_id, --
       mp.terminal_id, --
       mp.client_privacy_flag, --
       mp.package_type_id, --
       mp.motive_status_id, --
       --mp.person_id,
       --mp.attention_date,            
       mp.comm_exception, --
       --mp.reception_type_id,
       mp.cust_care_reques_num, --
       mp.tag_name, --
       mp.company_id, --
       --mp.pos_oper_unit_id,
       --mp.expect_atten_date,
       mp.comment_ --,
       --mp.contact_id,
       --mp.init_register_date      
       --mp.subscription_pend_id,
       --mp.subscriber_id
       )
    values
      (nupackage_id, --mp.package_id, --
       sysdate, --mp.request_date, --
       sysdate, --mp.messag_delivery_date, --
       Isbuser_id, -- mp.user_id, --
       nvl(Isbterminal,''), --mp.terminal_id, --
       'N', --mp.client_privacy_flag, --
       100287, --mp.package_type_id, --
       14, --mp.motive_status_id, --
       --mp.person_id,
       --mp.attention_date, 
       'N', --mp.comm_exception, --
       --mp.reception_type_id,
       0, --mp.cust_care_reques_num, --
       'P_LDC_CAMBIO_DE_ESTADO_100287', --mp.tag_name, --
       99, --mp.company_id --,--
       --mp.pos_oper_unit_id,
       --mp.expect_atten_date,
       'Activacion del producto[' || InuPRODUCTO ||
       '] mediante el CASO '||SBCASO ----mp.comment_,
       --mp.contact_id,
       --mp.init_register_date
       --nucontrato, ---subscription_pend_id ,
       --nucliente ---mp.subscriber_id 
       );
    --Inicio Registro de Solcitud           
  
    --Inicio Registro de Motivo
    nuMOTIVE_ID := SEQ_MO_MOTIVE.NEXTVAL;
    insert into open.mo_motive
      (MOTIVE_STATUS_ID,
       MOTIVE_TYPE_ID,
       PRIORITY,
       MOTIV_RECORDING_DATE,
       TAG_NAME,
       PRODUCT_MOTIVE_ID,
       CUST_CARE_REQUES_NUM,
       CUSTOM_DECISION_FLAG,
       IS_IMMEDIATE_ATTENT,
       IS_MULT_PRODUCT_FLAG,
       CLIENT_PRIVACY_FLAG,
       PROVISIONAL_FLAG,
       PRIVACY_FLAG,
       PACKAGE_ID,
       MOTIVE_ID,
       AUTHORIZ_LETTER_FLAG,
       PARTIAL_FLAG,
       product_id,
       subscription_id)
    values
      (11, --MOTIVE_STATUS_ID,
       9, --MOTIVE_TYPE_ID,
       100, --PRIORITY,
       sysdate, --MOTIV_RECORDING_DATE,
       'M_CAMBIO_DE_ESTADO_100284', --TAG_NAME,
       100284, --PRODUCT_MOTIVE_ID,
       0, --CUST_CARE_REQUES_NUM,
       'N', --CUSTOM_DECISION_FLAG,
       'Y', --IS_IMMEDIATE_ATTENT,
       'N', --IS_MULT_PRODUCT_FLAG,
       'N', --CLIENT_PRIVACY_FLAG,
       'N', --PROVISIONAL_FLAG,
       'N', --PRIVACY_FLAG,
       nupackage_id, --PACKAGE_ID,
       nuMOTIVE_ID, --MOTIVE_ID,
       'N', --AUTHORIZ_LETTER_FLAG,
       'N', --PARTIAL_FLAG
       InuPRODUCTO, --product_id,
       Inucontrato --subscription_id  
       );
  
    --dbms_output.put_line('*********Producto [' || InuPRODUCTO || '] - Tramite [' || nupackage_id || ']');
  
  exception
    when others then
      rollback;
      nuControlError := 1;
      --dbms_output.put_line('Error generando Tramite al producto [' || InuPRODUCTO || ']');
      null;
  END;
  ----------------------------------------------------

begin

  --dbms_output.put_line('Inicio proceso DATAFIX Hora Incial[' || sysdate || ']');

  open cuuser_id;
  fetch cuuser_id
    into rfcuuser_id;
  if cuuser_id%found then
    sbuser_id  := rfcuuser_id.user_id;
