    if cu100321%found then
      if rfcu100321.cantidad = 0 then
      
        begin
        
          nuControlError := 0;
          --dbms_output.put_line('nuControlError[' || nuControlError || ']');
        
          LDC_CAMBIO_ESTADO_PROD_DATAFIX(rfcuproductos.PRODUCTO);
        
          --dbms_output.put_line('nuControlError[' || nuControlError || ']');
          if nuControlError = 0 then
          
            open cuContrato(rfcuproductos.PRODUCTO);
            fetch cuContrato
              into rfcuContrato;
            if cuContrato%found then
              nuContrato := rfcuContrato.contrato;
              nuCliente  := rfcuContrato.cliente;
            end if;
            close cuContrato;
          
            LDC_TRAMITE_MOTIVO(rfcuproductos.PRODUCTO,
                               nuContrato,
                               nuCliente,
                               sbuser_id,
                               sbterminal);
          
            if nuControlError = 0 then
              commit;
            else
              --dbms_output.put_line('*****************No se genero Tramite ni se cambio estado del Producto[' ||
              --                     rfcuproductos.PRODUCTO || ']');
              rollback;
            end if;
          
          end if;
        
        exception
          when others then
            rollback;
            null;
        end;
      
      else
        dbms_output.put_line('**********************El prodcuto [' ||
                             rfcuproductos.PRODUCTO ||
                             '] Tiene solicitud 1000321 en proceso');
      end if;
    end if;
    close cu100321;
  
  end loop;  

end;
